    a = [[int(x) for x in stdin.split()] for _ in range(n)]

    def max_sum(row):
        max_sum = 0
        for i in range(m):
            max_sum = max(max_sum, row[i])
        return max_sum

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    def choose(row, i, k):
        total = 0
        for j in range(m):
            if j!= i and j!= k:
                total += row[j]
        return total

    def max_sum_divisible(row, k):
        total = row[0]
        for i in range(1, m):
            total += row[i]
            if total % k == 0:
                return total

        return total

    result = 0
    for i in range(n):
        row = sorted(a[i], reverse=True)
        max_sum_k = max_sum_divisible(row, k)
        row = [0] * m
        for j in range(m):
            if j < m // 2:
                row[j] = row[j] + choose(row, j, j)
            else:
                row[j] = row[j] + choose(row, j, j + 1)
        max_sum_k_lcm = lcm(max_sum_k, max_sum(row))
        result = max(result, max_sum_k_lcm)

    return str(result)

