    def find(parent, u):
        if parent[u] == u:
            return u
        parent[u] = find(parent, parent[u])
        return parent[u]

    def union(parent, u, v):
        u_root = find(parent, u)
        v_root = find(parent, v)
        if u_root == v_root:
            return False
        parent[u_root] = v_root
        return True

    def min_spanning_tree(edges, n, parent, edges_cost):
        edges_cost.sort(key=lambda x: x[2])
        edges_used = set()
        edges_used.add(edges_cost.pop(0))
        used = set()

        while edges_cost:
            e = edges_cost.pop(0)
            u, v, w = e
            if not union(parent, u, v):
                used.add(e)
                edges_used.add(e)
                if len(used) == n:
                    break
            else:
                edges_cost.append(e)

        return used

    parent = [i for i in range(n)]
    edges_cost = [(u, v, w) for u, v, w in edges]
    mst_cost = min_spanning_tree(edges, n, parent, edges_cost)

