        edges.append((x, y, w))

    g = [[] for _ in range(n + 1)]
    for u, v, w in edges:
        g[u].append((v, w))
        g[v].append((u, w))

    def bellman_ford(start: int) -> int:
        dist = [float('inf')] * (n + 1)
        dist[start] = 0
        for i in range(n - 1):
            for u in range(1, n + 1):
                for v, w in g[u]:
                    if dist[u]!= float('inf') and dist[u] + w < dist[v]:
                        dist[v] = dist[u] + w
        return dist

    def kth_smallest_shortest_path(start: int, k: int) -> int:
        shortest_paths = [bellman_ford(start) for _ in range(n + 1)]
        sorted_paths = sorted(shortest_paths[1:], key=lambda x: x)
        return sorted_paths[k - 1]

    return str(kth_smallest_shortest_path(1, k))

