def solution(stdin: str) -> str:
    h, w = map(int, stdin.split())
    s = [list(map(lambda x: x == '#', stdin.split())) for _ in range(h)]
    black_paint = 0

    def is_valid(i: int, j: int) -> bool:
        return 1 <= i <= h and 1 <= j <= w

    def is_adjacent(i: int, j: int) -> bool:
        if s[i][j]:
            return False
        if i == 1 and s[i][j - 1]:
            return False
        if i == h and s[i - 1][j]:
            return False
        if j == 1 and s[i - 1][j]:
            return False
        if j == w and s[i - 1][j]:
            return False
        return True

    def flood_fill(i: int, j: int) -> int:
        if not is_valid(i, j):
            return 0
        if s[i][j]:
            black_paint += 1
            return 0
        if s[i][j - 1]:
            black_paint += flood_fill(i, j - 1)
        if s[i - 1][j]:
            black_paint += flood_fill(i - 1, j)
        if s[i - 1][j - 1]:
            black_paint += flood_fill(i - 1, j - 1)
        return black_paint

    for i in range(h):
        for j in range(w):
            if s[i][j] == '#' and is_adjacent(i, j) and is_valid(i, j):
                flood_fill(i, j)

    if black_paint == 1:
        return 'Yes'
    else:
        return 'No'

