    n, k = map(int, stdin.split()[0].split())
    tiles = list(map(list, stdin.split()[1:n+1]))

    visited = set()
    start_tile = tiles.index([1] * n)
    end_tile = tiles.index([k] * n)
    if start_tile == end_tile:
        return "0"

    distances = [float('inf')] * (n * n)
    distances[start_tile] = 0

    def bfs(tile):
        queue = [tile]
        while queue:
            current_tile = queue.pop(0)
            if current_tile == end_tile:
                return distances[current_tile]
            if current_tile not in visited:
                visited.add(current_tile)
                for neighbor in tiles[current_tile]:
                    new_distance = distances[current_tile] + abs(current_tile // n - neighbor // n) + abs(current_tile % n - neighbor % n)
                    if new_distance < distances[neighbor]:
                        distances[neighbor] = new_distance
                        queue.append(neighbor)

    shortest_distance = float('inf')
    for i in range(n):
        shortest_distance = min(shortest_distance, bfs(start_tile))

    if shortest_distance == float('inf'):
        return -1

    return str(shortest_distance)

