def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    students = list(map(int, stdin.split()[1:]))
    rooms = [[] for _ in range(n + 1)]

    for student, room in zip(students, rooms):
        room.append(student)

    visited = [False] * (n + 1)
    visited[1] = True

    def redistribute(room: int) -> None:
        exams = rooms[room]
        for exam in exams:
            if exam == student:
                continue
            if not visited[room]:
                visited[room] = True
                exams.append(exam)
            else:
                rooms[room].remove(exam)
                rooms[n].append(exam)

    def find_safe_order() -> bool:
        for i in range(1, n + 1):
            if rooms[i]:
                redistribute(i)
                if not any(visited):
                    return True
                redistribute(i)
                rooms[i].clear()
        return False

    if not find_safe_order():
        return "impossible"

    for i in range(1, n + 1):
        if rooms[i]:
            redistribute(i)
            break

    safe_order = [i for i in range(1, n + 1) if rooms[i]]
    return " ".join(map(str, safe_order))

